import { getDay } from "date-fns";

/**
 * Adding up
 * @description Adds up two numbers
 * @async
 * @author Andreas Groos
 * @param {number} one - first number
 * @param {number[]}  two -second number
 * @returns  {Array<number>}  the sum of one and two
 */
export const sum = async (one, two) => {
  // some async stuff
  return (await one) + two;
};

/**
 * Joins 2 arrays
 *
 * @param {number[]} arr1 first array is of numbers only!
 * @param {string[]} arr2 second array contains only strings
 * @returns {Array} joined array
 */
export function joinArr(arr1, arr2) {
  return arr1.concat(arr2);
}

/**
 *  Returns the name of day in German
 *
 * @export dayInGerman
 * @param {Date|String|Number} date - the given day
 * @returns {String} the day of week in German language
 */
export function dayInGerman(date) {
  const day = getDay(date);
  switch (day) {
    case 0:
      return "Montag";
      break;
    case 1:
      return "Dienstag";
    default:
      return "Sonntag";
  }
}

/**
 * multiplies by 10
 *
 * @param {number} a a number
 * @returns {number} x10
 * @example test(20) = 200
 */
export function times10(a) {
  return a * 10;
}

/**
 *
 * constructs a Polygon
 *
 * @class Polygon
 */
class Polygon {
  /**
   * Creates an instance of Polygon.
   * @param {Number} height - height of Polygon
   * @param {Number} width - width of Polygon
   * @memberof Polygon
   */
  constructor(height, width) {
    this.name = "Polygon";
    this.height = height;
    this.width = width;
  }

  /**
   * console.logs greeting
   *
   * @param {string} text - part of greeting
   * @memberof Polygon
   */
  sayName(text) {
    console.log("Hi, I am a ", this.name + ".");
  }

  /**
   * console.logs more info
   * @description lorem ipsum ....
   *
   * @memberof Polygon
   */
  sayHistory() {
    console.log(
      '"Polygon" is derived from the Greek polus (many) ' + "and gonia (angle)."
    );
  }
}

